import './Decor.css';

import Decor1 from '../Decor/Decor.webp'

import { Container } from "react-bootstrap";

function Decor(){
    return(
        <div>
            <Container fluid>
                <div className = "decor">

                    <div className = "decor__content">
                        <h1>Wall Decor</h1>
                    </div>

                    <div className = "decor_image">
                        <img src = {Decor1} className = "w-100"/>
                    </div>

                </div>
            </Container>
        </div>
    )
}

export default Decor
